import React from 'react';
import './EditItem.css';

const EditItem = ({ item }) => {
  return (
    <div className="edit-item">
      <h2>Edit Item</h2>
      <p>Name: {item.name}</p>
      <p>Description: {item.description}</p>
      <p>Price: {item.price}</p>
    </div>
  );
};

export default EditItem;
